    function successVideoLiveness(faceValidationResultMessage) {
        if (dummyFace || (faceValidationResultMessage.result == MobbScanValidationState.VALID.value)) {
            $('#idLiveness').removeClass("defaultLivenessImg");
            $('#idLiveness').addClass("capuredImg");
            $('#idLiveness').attr("src", "data:image/png;base64, " + faceValidationResultMessage.resultData.face);
            $('#btnSelfieBtnCont').hide();
            $('.successLiveness').show();
        } else if (faceValidationResultMessage.result == MobbScanValidationState.NOT_VALID.value) {
            showSimpleMessage(CORE_TAG('DefaultTitle'), 'NOT_VALID:===> ' + JSON.stringify(faceValidationResultMessage), undefined);
            showSimpleMessage(CORE_TAG('DefaultTitle'), 'La validación no ha sido satisfactoria, por favor repite tu Selfie.', startVideoLiveness);
        } else {
            // NOT_CHECKED
            showSimpleMessage(CORE_TAG('DefaultTitle'), 'NOT_CHECKED:===> ' + JSON.stringify(faceValidationResultMessage), undefined);
            showSimpleMessage(CORE_TAG('DefaultTitle'), 'No pudimos validar tu rostro, por favor repite tu Selfie.', startVideoLiveness);
        }
        stopProcess();
    }



    function failVideoLiveness(faceValidationResultMessage) {
        //console.log(JSON.stringify(faceValidationResultMessage, null, 2));
        showSimpleMessage(CORE_TAG('DefaultTitle'), "Facial Matching ERROR: " + faceValidationResultMessage.error.errorCode, startVideoLiveness);
        showSimpleMessage(CORE_TAG('DefaultTitle'), "Facial Matching ERROR: " + JSON.stringify(faceValidationResultMessage.error), undefined);
        showSimpleMessage(CORE_TAG('DefaultTitle'), "Facial Matching ERROR: " + JSON.stringify(faceValidationResultMessage), undefined);
        stopProcess();
    }



    return viewModel;
